 REST API plugin</a> geïnstalleerd en geactiveerd omdat op deze site <a href="%2$s">de verouderde REST API is ingeschakeld</a> of <a href="%3$s">verouderde webhooks zijn gedefinieerd</a>. <a href="%4$s">Meer informatie</a>','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce heeft <a href="%1$s">de Legacy REST API plugin</a> geïnstalleerd, omdat deze site <a href="%2$s">de Legacy REST API heeft ingeschakeld</a> of <a href="%3$s">verouderde webhooks heeft gedefinieerd</a>, maar het activeren is mislukt (zie fout details in <a href="%4$s">de WooCommerce logs</a>). Ga naar <a href="%5$s">de plugins pagina</a> en activeer hem handmatig. <a href="%6$s">Meer informatie</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce heeft de Legacy REST API plugin geïnstalleerd maar is er niet in geslaagd deze te activeren, zie de context voor meer gegevens.','Please enter a valid email at checkout to use coupon code "%s".'=>'Voer bij het afrekenen een geldig e-mailadres in om waardeboncode "%s" te gebruiken.','Please enter a valid email to use coupon code "%s".'=>'Voer een geldig e-mailadres in om waardeboncode "%s" te gebruiken.','To allow logging, make %s writable.'=>'Om loggen mogelijk te maken, maak %s schrijfbaar.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Lokaal afhalen: stel afhaallocaties in op de <a href="%s">lokaal afhalen instellingenpagina</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pick