orie link','A link to a product category.'=>'Een link naar een product categorie.','Product Tag Link'=>'Product tag link','A link to a product tag.'=>'Een link naar een product tag.','Product Link'=>'Productlink','A link to a product.'=>'Een link naar een product.','Invalid path provided.'=>'Ongeldig pad opgegeven.','How easy was it to add a product tag?'=>'Hoe eenvoudig was het om een product tag toe te voegen?','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Om er zeker van te zijn dat de meldingen van je winkel aankomen in de inbox van je klanten, raden we aan je e-mailadres aan je domein te koppelen en een speciale SMPT server in te stellen. Als het erop lijkt dat iets niet goed wordt verzonden, installeer je de <a href="%1$s">WP Mail Logging plugin</a> of ga je naar de pagina <a href="%2$s">Veelgestelde vragen over e-mail</a>.','Zulia'=>'Zulia','Yaracuy'=>'Yaracuy','Trujillo'=>'Trujillo','Táchira'=>'Táchira','Sucre'=>'Sucre','Capital'=>'Capital','Filling in progress (%d)'=>'Wordt gevuld (%d)','Product attributes lookup table data is regenerating'=>'Gegevens voor opzoektabel voor productattributen worden opnieuw gegenereerd','Delta Amacuro'=>'Delta Amacuro','Federal Dependencies'=>'Federale gebieden','Portuguesa'=>'Portugees','Nueva Esparta'=>'Nueva Esparta','Monagas'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Mérida','Lara'=>'Lara','Guárico'=>'Guárico','Falcón'=>'Falcón','Cojedes'=>'Cojedes','Carabobo'=>'Carabobo','Bolívar'=>'Bolívar','Barinas'=>'Barinas','Aragua'=>'Aragua','Apure'=>'Apure','Anzoátegui'=>'Anzoátegui','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Dit gereedsch