oductcategorie moet worden geëxporteerd?','Export all categories'=>'Alle categorieën exporteren','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'We raden je aan om ShipStation te gebruiken om tijd te besparen op het postkantoor door je verzendlabels thuis af te drukken. Probeer ShipStation 30 dagen gratis.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Als je de <span class="help_tip" data-tip="%1$s">huidige tarieven</span> van een specifieke bezorger (bijv. UPS) wilt aanbieden, kun je <a href="%2$s" target="_blank">hier</a> verschillende extensies vinden voor WooCommerce.','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'De huidige tarieven zijn de exacte kosten om een bestelling te verzenden, waarbij de offerte rechtstreeks afkomstig is van de bezorger.','ShipStation'=>'ShipStation','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'We gebruiken %1$s voor het gewicht van het product en %2$s voor de productafmetingen.','Set up Stripe for me using this email:'=>'Configureer Stripe voor me met dit e-mailadres:','WooCommerce PayPal Checkout Gateway'=>'WooCommerce PayPal Checkout Gateway','Low stock amount'=>'Lage voorraad','Set up PayPal for me using this email:'=>'Configureer PayPal voor me met dit e-mailadres:','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'We hebben twee verzendzones aangemaakt: voor %s en voor de rest van de wereld. Hieronder kun je een vast verzendtarief instellen voor deze zones of gratis verzending aanbieden.','When handling an %s, should personal data within orders be retained or removed?'=>'Moeten